package com.example.alumnomy.paises;


import android.support.v7.app.AppCompatActivity;
import android.os.Bundle;
import android.view.View;
import android.widget.AdapterView;
import android.widget.ArrayAdapter;
import android.widget.ListView;
import android.widget.TextView;

public class MainActivity extends AppCompatActivity {

    private String cadena= "";
    private String[] paises = { "España", "Francia", "Portugal", "Bélgica", "Holanda", "Luxemburgo", "Alemania", "Italia" ,
            "Nombres Inversa","Paises por Población","Poblacion > 20 millones","Poblacion > 20 millones y < 80 millones",
            "Poblacion distinta de 67 millones.", "Primera cifa de población sea 5 o 6","Mayor de 1 millón e impar", "Mayor de 1 millón y par"};
    private String[] habitantes = { "46000000", "67000000", "10000000", "11000000", "17000000", "500000", "82000000", "60000000"};
    private long[] habs = { 46000000, 67000000, 10000000, 11000000, 17000000, 500000, 82000000, 60000000};
    private int[] ordenPob = {0,1,2,3,4,5,6,7};
    private TextView tv1;
    private ListView lv1;

    @Override
    protected void onCreate(Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);
        setContentView(R.layout.activity_main);
        tv1=(TextView)findViewById(R.id.tv1);
        lv1 =(ListView)findViewById(R.id.list1);

        ArrayAdapter <String>adapter = new ArrayAdapter<String>(this,android.R.layout.simple_list_item_1, paises);
        lv1.setAdapter(adapter);
        lv1.setOnItemClickListener(new AdapterView.OnItemClickListener() {
            @Override
            public void onItemClick(AdapterView adapterView, View view, int i, long l) {
                if (i==8) {
                    tv1.setText("Países en orden inverso:\n" + lv1.getItemAtPosition(7) + " - " + lv1.getItemAtPosition(6)
                            + " - " + lv1.getItemAtPosition(5) + " - " + lv1.getItemAtPosition(4)
                            + " - " + lv1.getItemAtPosition(3) + " - " + lv1.getItemAtPosition(2)
                            + " - " + lv1.getItemAtPosition(1) + " - " + lv1.getItemAtPosition(0));
                }else if (i==9) {
                    String pals="";
                    for (int a=0;a<7;a++) {
                        pals = pals + lv1.getItemAtPosition(ordenPob[a]) + " es: " + habitantes[ordenPob[a]] + "\n";
                    }
                    tv1.setText("Países en orden población: \n" + pals);
                } else if (i==10) {
                    String cadena="";
                    for (int x=0; x<8;x++){
                        if (habs[x]>20000000){
                            cadena=cadena+lv1.getItemAtPosition(x)+"\n";

                        }
                            tv1.setText("Paises con mas de 20M: \n" + cadena);
                    }

                } else if (i==11) {
                    String cadena="";
                    for (int x=0; x<8;x++){
                        if (habs[x]>20000000 && habs[x]<80000000){
                            cadena=cadena+lv1.getItemAtPosition(x)+"\n";

                        }
                        tv1.setText("Paises con mas de 20M y menos de 80M: \n" + cadena);
                    }

                } else if (i==12) {
                    String cadena="";
                    for (int x=0; x<8;x++){
                        if (habs[x]!=67000000){
                            cadena=cadena+lv1.getItemAtPosition(x)+"\n";

                        }
                        tv1.setText("Paises que no tienen 67M: \n" + cadena);
                    }

                } else if (i==13) {
                    String cadena="";
                    for (int x=0; x<8;x++){
                        if ((habitantes[x].charAt(0)=='5') || (habitantes[x].charAt(0)=='6') ){
                            cadena=cadena+lv1.getItemAtPosition(x)+"\n";

                        }
                        tv1.setText("Paises cuya poblacion empieza en 5 o 6: \n" + cadena);
                    }

                } else if (i==14) {
                    cadena= "";
                    int segundacifra;
                    for(int a=0; a<8; a++)
                        if(habs [a] >= 1000000){
                            segundacifra=habitantes[a].charAt(habitantes[a].length()-7);
                            if(segundacifra%2==0){
                                cadena = cadena + lv1.getItemAtPosition(a) + "\n";
                            }
                        }
                    tv1.setText("Países cuya población sea mayor de 1 millón y el número de millones sea impar: \n" + cadena);
                }else if (i==15) {
                    cadena= "";
                    int segundacifra;
                    for(int a=0; a<8; a++)
                        if(habs [a] >= 1000000){
                            segundacifra=habitantes[a].charAt(habitantes[a].length()-7);
                            if(segundacifra%2!=0){
                                cadena = cadena + lv1.getItemAtPosition(a) + "\n";
                            }
                        }
                    tv1.setText("Países cuya población sea mayor de 1 millón y el número de millones sea par: \n" + cadena);
                } else{
                    tv1.setText("La población de " + lv1.getItemAtPosition(i) + " es: " + habitantes[i]);
                }
            }
        });
    }
}
